import styled from 'styled-components';;
import Products from '../components/Products';

const Inner = styled.div`
	max-width: ${props => props.theme.maxWidth};
	margin: 0 auto;
	padding: 2rem;
	font-size: 20px;
`;

export default function ProductPage() {
  return (
    <div>
        <Products />
    </div>
  );
}
